import pandas as pd

"""**The exact same process would be repeated for each year 2018,2019,2020,2021,2022 .**

The goal is to first obtain the yearwise dataset of every tier2 city and then merge all years information to make final dataset of each city![1.png](data:image/png;base64,)
"""

# Read in the temperature data for all cities
all_cities_data = pd.read_csv('/content/Oct_to_Dec_2019.csv')

# Define the list of Tier-2 cities in Telangana
tier2_cities = ["Warangal", "Karimnagar", "Nizamabad", "Khammam", "Nalgonda", "Adilabad", "Siddipet"] # Replace with actual Tier-2 city names

# Iterate through the Tier-2 cities and save a separate file for each city
for city in tier2_cities:
    # Filter the data for the current city
    city_data = all_cities_data[all_cities_data['District'] == city]
    
    # Save the data for the current city to a separate file
    city_data.to_csv(f'{city}_oct_2019_temperature_data.csv', index=False)

